import { BrowserRouter } from 'react-router-dom';
import "../node_modules/bootstrap/dist/css/bootstrap.min.css";
import Main from './Main';

function App() {
  return (

    <>

      <BrowserRouter>



        <div className="design">
          <NavLink to='/' style={({ isActive }) => ({color:isActive ? "blue" : "white"}) } > <a>home</a></NavLink>
          <NavLink to='/about' style={({ isActive }) => ({ color: isActive ? "blue" : "white" })} > <a>about</a> </NavLink>
          <NavLink to='/contact' style={({ isActive }) => ({ color: isActive ? "blue" : "white" })} > <a>contac</a> </NavLink>
          <NavLink to='/user' > <a>user</a> </NavLink>
        </div>

        <Main />

      </BrowserRouter>


    </>

  );
}

export default App;
